INSERT INTO `pages` VALUES (1,'Welcome','welcome','h1{font-family:futura; color:#FA0045; font-weight:normal; line-height:150%;}. Welcome to London Flatmate, _the_ best place on the web to advertise your flat share and find a new flat mate.\r\n\r\nWe\'ve taken all the hard work out of trying to find a flatshare and finding a new flat mate for your flatshare.  \r\n\r\nOur adverts are detailed and accurate, if there not tell us and we\'ll make sure the owner sorts it out!  We\'ll look through all our adverts and intelligently provide suggestions for flats or flat mates.\r\n\r\nh2{font-family:futura; color:#FA0045; font-weight:normal;}. Flatshares\r\n\r\nLooking for somewhere to live? Search through \"flatshare adverts\":http://localhost:3001/flatshares\r\n\r\nh2{font-family:futura; color:#FA0045; font-weight:normal;}. Flatseekers\r\n\r\nTrying to find someone to fill a spare room, take a look at our \"flatseeker adverts\":http://localhost:3001/flatseekers\r\n\r\nh2{font-family:futura; color:#FA0045; font-weight:normal;}. Place an Advert\r\n\r\nIt is quick and easy to set up an advert, just create an account, just click \"here\":http://localhost:3001/users',0,0),(2,'flatseeker_search','','h1{font-family:futura; color:#FA0045; font-weight:normal;}. Flatseeker Search\r\n\r\nUse the search controls to your left to find people looking for flat shares.  You can search on the amount someone is willing to pay, or the area they are interested in living.\r\n\r\nBy seeking out people who are actively looking for a flat you stand a _much_ greater chance of finding the right flatmate for your flat share.\r\n\r\nLook for people who are looking for flats in your area and once you find someone who you think would be interested in your flat contact them and ask them to come round and view your flat.',0,0),(3,'flatshare_search','','h1{font-family:futura; color:#FA0045; font-weight:normal;}. Flatshare Search\r\n\r\nUse the search form above to search for flat share adverts.  You can search by the maximum amount of rent you wish to pay and also the location you wish to live in.  It is also possible to find flats within a certain distance of a tube or train station.\r\n\r\nMatching adverts are displayed as markers on the map, use this to determine where the flats are located within the area.\r\n\r\nTo get a better idea of what the location is like you can search for amenities in the local area, using the search box on the map.  Search for local bars, supermarkets, cafes, gyms restaurants.',0,0),(4,'my_account','','This is where you can control your account.  View and respond to messages you have been sent, view or edit your advert if you have one set up.\r\n\r\nWe will also list here any adverts we think you might be interested in.\r\n\r\nYou can also change your account details at anytime from this page.',NULL,0),(5,'map_adverts','','All your matching adverts are shown as markers on the map to the right, click on each marker to get more details about each matching advert.\r\n\r\nIf you find one that you are interested in why not either send them a message or call the advert owner up and arrange a viewing.',NULL,0),(6,'payments','payments','h1{font-family:futura; color:#FA0045; font-weight:normal; line-height:150%;}. Nearly there!\r\n\r\nActivating your account will cost _just_ Â£3!  You can pay using paypal by clicking on the button below, alternatively if you have a promotion code enter it in the box below, click OK and you\'ll be set up free of charge.\r\n\r\nWe will only ever charge you once, there are no extra fees for contacting other adverts and once activated you can set up an advert for as long as you need it.\r\n\r\nCharging just a small amount means that the adverts that you do see on this site are of a much higher quality than you might find on other \'free\' websites.\r\n\r\nIf you have a paypal account you can use that to pay, otherwise just create one, it only takes a minute.',0,0),(7,'payment_confirmation','','h1{font-family:futura; color:#FA0045; font-weight:normal; line-height:150%;}. Last Page...\r\n\r\nConfirm that your details shown here are correct and then press the \'Complete Payment\' button, you will then have your account activated.',0,0),(8,'Flatshare Areas','flatshare_areas','London is a big *big* place.  It is probably best, when searching for a flatshare, to choose one or two areas that you like and focus on these rather than going flatshare hunting across the whole of London.  This is because traveling from one end of London to the next looking for a flatshare is both time consuming and expensive.\r\n\r\nThere are some _classic_ areas of London for flatsharing, Clapham, Fulham, Earls Court and Islington to name just a few, however you can probably find a decent amount of flatshares in any area.\r\n\r\nIt probably goes without saying, I\'ll say it anyway though, look for a flat in an area where you can easily get to work/college from.  That flat might seem nice but having a daily commute that involves three busses a train a tube _and_ a 20 min walk will get old very quickly!\r\n\r\nGo and get a feel for your prospective areas, walk around them, you can even search for bars, restaurants, pubs, gyms or anything else that is important to you whilst searching for flatshares on this site.',1,0),(9,'How Much Will It Cost?','how_much_will_it_cost','As well as being a big place, London is also an _expensive_ place to live, but don\'t worry, by flatsharing you can afford to live in fairly nice places.\r\n\r\nExpect to pay anywhere from about Â£250 a month to Â£1500+ depending on location, the size and quality of the flat/room and how much other people want to live there.  Simple things like the distance to a tube station can greatly increase the amount of rent you will have to pay for a given room, is being 100m from a tube stop _that_ important to you?\r\n\r\nAs well as rent you also have to pay for bills and council tax.  Bills will vary from flatshare to flatshare, each advert on this site has to include an amount that you will be expected to contribute each month towards flatshare bills.\r\n\r\nCouncil tax is a tax levied by the local government to pay for things such as bin collection, police, ambulance and those lovely traffic wardens.  Be aware that it varies between the different London boroughs, and it can vary a lot, always check how much council tax will be when you look at prospective flatshares.',1,0),(10,'Rules For Happy Flatsharing','rules_for_happy_flatsharing','Flatsharing can be a bit of a scoial minefield, it needn\'t be, follow this simple rules and you\'ll probably survive just fine, heck you might even enjoy it and make some lifelong friends!\r\n\r\n* Clean\r\n\r\n* (big)Clean\r\n\r\n* *_(big)Clean_* - yes it really is that important, most tensions in a flatshare will probably stem from differences in peoples opinion on what is clean and the frequency with which things should be cleaned.  Just wash up your dirty dishes, hoover the lounge and clean the bathroom once in a while and you\'ll find yourself living in a much nice flatshare environment.\r\n\r\n* Don\'t \"borrow\" food/alcohol/drugs/clothes/partners etc - nothing is going to irritate your flatmate more than waking up with a huge hangover, their only saviour being their carton of orange juice in the fridge, only to find out that someone has \"borrowed\" it!  If it isn\'t yours _ask!_\r\n\r\n* Don\'t take over the bathroom - a sure fire way to make a happy flatshare deteriorate into world war 3 is to spend 45 minutes in the bathroom on a weekday morning at 08:30, just be considerate. \r\n\r\n* Don\'t party all night every night in the flat - if you know your flatmate has to get up for work at half 6 and you don\'t then thats great (for you at least).  Don\'t however decide to celebrate this fact with your 20 closest mates in the living room at 3am.',1,0),(11,'Big Flatshare Arguments','big_flatshare_arguments','Whether you like it or not, they will happen, nine times out of ten you will end up in a massive argument with your flat mates over one of the following things -\r\n\r\n* Cleaning (or lack of it)\r\n* Noise too late at night\r\n* Food/drink etc going \"missing\"\r\n* Friends/partners staying over too often/constantly\r\n* Bathroom abuse\r\n\r\nThe reasons for big flatshare arguments are almost always trivial but they can bring out such anger in people that you would think that the issues were a matter of life and death.\r\n\r\nYou *are* allowed to get mad with people, from time to time your flatmates _might_ even be allowed to loose their temper with you.  When situations like this occur it is always best to try and have a serious talk with every one in the house, a dreaded house meeting, so that everyone can feel that they have their opinion heard.\r\n\r\nDon\'t make any rash decisions, by walking out on a flatshare and moving somewhere else you are not going to ruin their lives, they\'ll probably find another flatmate and you will probably be the topic of drunken laughs for your ex-flatmates for quite a while, better to sort it out and perhaps do the dishes every now and then....',1,0),(12,'Who makes a good flatmate','who_makes_a_good_flatmate','There is a *big* difference between people who you are mates with and people who you live with, the two can often be mutually exclusive.  It is all too easy to move in with a good mate and take advantage or not give that person the same respect you would if you didn\'t know them too well, this is a recipe for disaster!\r\n\r\nRemember also that your new flatmates are not automatically your mates, don\'t rely on them to be a ready made group of friends for you if you\'re new to London, they probably have lives of their own to lead!\r\n\r\nIt is important to tackle the issue of who you are and are not willing to share a flat with, ignoring this issue will lead to awkwardness, arguments, irritation and possible death later on in the flatshare.  Have in mind the kind of people you want to live with and wouldn\'t live with when you go and visit a prospective flatshare, do these people fall into the list of people you wouldn\'t flatshare with if your life depended on it?  Probably give that one a miss then...',1,0),(13,'Who Buys the ....','who_buys_the','In can be whatever, toilet roll, milk, washing up liquid etc etc.  If it is something that is basically communal then there will always be space for people to abuse the more diligent people who remember to buy more toilet paper.\r\n\r\nIf you seem to always be buying these things and find yourself getting a _little_ bit annoyed that its always you, buy it again, then once more, and one final time.  From now on, keep it in your room.  You cannot be expected to parent the other people in the flatshare, and vice versa.\r\n\r\nThe people in your flatshare can seem like a ready made family, which can be good in the big bad city, but they _almost_ certainly don\'t love you and they definitely are not their to look after you, you\'re an adult, you should be able to do that yourself!',1,0),(14,'Double Room','double_room','When looking at adverts on this site, or indeed anywhere that you choose to look, you will often see rooms advertised as a \"Double Room\".  On this site a double room is not any of the following; a room for two people, a room which someone has managed to fit a double bed in it.\r\n\r\nA double room should be easily big enough for a double bed as well as some other furniture.  If you see adverts that are misleading in this way on this website then you should flag them as inaccurate.  We will take action, making sure that any inaccurate adverts are changed, or removed, so that no one else has their time wasted.\r\n\r\nThis goes for any other aspect of an advert, be honest, if the room is a single with a double bed in it, say so.  If there isn\'t a lounge but instead a kitchen with a tv and a sofa, then say so.  These are the kind of things that people _tend_ to notice when they come round to view the flat.',1,0),(15,'Tips for a successful advert','tips_for_a_sccessful_advert','Setting up an advert?  Follow these tips to get the most out of this site and get the _right_ kind of interest and have less of your time wasted.\r\n\r\n*Detail, detail, detail*\r\nThe more that you write in the description of your advert the better.  If you don\'t put enough in there, people aren\'t going to bother contacting you.  You have to put in at least 100 characters but we strongly advise putting in as much as possible.\r\n\r\nAny adverts that just write rubbish or non-related things in this field will be removed, each advert _is_ checked.\r\n\r\n*A picture is worth a thousand words*\r\nIt\'s true, add a couple of pictures and your advert is already more interesting than an advert without pictures.  All adverts with pictures are flagged and consistently get viewed more than those without pictures, get that camera out and get snapping!\r\n\r\n*Write a catchy headline*\r\nThe headline is what will be displayed first before anything else when people are searching for flatshares or flatmates.  Be as imaginative as you can and use it to grab peoples attention.\r\n\r\n*Be accurate*\r\nThis is _very_ important, we all want our advert to shine out amongst all the others but don\'t exaggerate anything.  You will end up wasting not only other peoples time, but also your own.  If people come round to view a large double room with an en-suite bathroom and in fact it is a single room with a sink they will not be impressed!  Also any adverts that are flagged as being inaccurate _will_ be removed.  You have been warned!\r\n\r\n*Tag your advert*\r\nUse the tags to give extra detail about your advert, if there isn\'t one that fits what you need then add it, it really is that simple.',1,0),(16,'Articles','articles','Here there is an absolute _wealth_ of knowledge about all things flatsharing.  Go through the articles to get some advice about the best way to set up your advert, tips for successful flatshare hunting and general thoughts and wisdom about how to survive flatsharing once you finally do have your new flatshare sorted out.',0,0),(17,'Quarantined Adverts','quarantined_adverts','Adverts are placed in quarantine because enough people have flagged your advert as being inaccurate.\r\n\r\nAt LondonFlatmate.net we take this _very_ seriously, if your advert has become quarantined it will not show up in any searches and we will not recommend your advert to anyone.\r\n\r\nIt is possible to remove an advert from quarantine by making your advert more accurate.  We will have sent owners of quarantined adverts an email with the comments that the people who flagged your advert as inaccurate made, use these to make your advert more accurate.\r\n\r\nStill having problems getting your advert out of quarantine, send us an email at ??email address here??.  If you feel that your advert has been quarantined without cause then please contact us also and we will investigate.',1,0),(18,'About Us','about-us','LondonFlatmate is a site that helps you quickly find a flat or find a new flatmate for your flatshare.',0,1),(19,'Contact Us','contact-us','You can contact us at this address',0,1);
